import React, { useEffect, useState } from "react";
import { initializeApp } from "firebase/app";
import {
  getFirestore,
  collection,
  getDocs,
  query,
  where,
} from "firebase/firestore";
import "./styles.css";

const firebaseConfig = {
  apiKey: "YOUR_API_KEY",
  authDomain: "YOUR_PROJECT_ID.firebaseapp.com",
  projectId: "YOUR_PROJECT_ID",
  storageBucket: "YOUR_PROJECT_ID.appspot.com",
  messagingSenderId: "YOUR_SENDER_ID",
  appId: "YOUR_APP_ID"
};


const app = initializeApp(firebaseConfig);
const db = getFirestore(app);

const categories = [
  { name: "Pizza", tag: "/tags/pizza", image: "https://cdn.ooni.com/images/pizza.jpg" },
  { name: "Dessert", tag: "/tags/dessert", image: "https://cdn.ooni.com/images/dessert.jpg" },
  { name: "Drink", tag: "/tags/drink", image: "https://cdn.ooni.com/images/drink.jpg" },
  { name: "Salad", tag: "/tags/salad", image: "https://cdn.ooni.com/images/salad.jpg" },
  { name: "Spaghetti", tag: "/tags/spaghetti", image: "https://cdn.ooni.com/images/spaghetti.jpg" },
  { name: "Special Offer", tag: "/tags/special-offer", image: "https://cdn.ooni.com/images/offer.jpg" },
];

function CategoryCard({ category, onClick }) {
  return (
    <div className="card" onClick={() => onClick(category.tag)}>
      <img src={category.image} alt={category.name} />
      <h3>{category.name}</h3>
    </div>
  );
}

function ItemCard({ item, onAddToCart }) {
  return (
    <div className="card">
      <img src={item.image} alt={item.name} />
      <h3>{item.name}</h3>
      <p>${item.price}</p>
      <button className="btn" onClick={() => onAddToCart(item)}>Add to Cart</button>
    </div>
  );
}

function App() {
  const [currentTag, setCurrentTag] = useState(null);
  const [items, setItems] = useState([]);
  const [cart, setCart] = useState([]);
  const [showPopup, setShowPopup] = useState(false);

  useEffect(() => {
    const loadItems = async () => {
      if (!currentTag) return;
      const q = query(collection(db, "menuItems"), where("tag", "==", currentTag));
      const snapshot = await getDocs(q);
      const loadedItems = snapshot.docs.map((doc) => ({ id: doc.id, ...doc.data() }));
      setItems(loadedItems);
    };
    loadItems();
  }, [currentTag]);

  const addToCart = (item) => {
    setCart([...cart, item]);
    setShowPopup(true);
    setTimeout(() => setShowPopup(false), 2000);
  };

  const clearCart = () => setCart([]);

  const total = cart.reduce((sum, item) => sum + item.price, 0);

  return (
    <div className="main-layout">
      <header className="header">
        <h1>Virtual Menu</h1>
        <nav>
          <a href="#" onClick={() => setCurrentTag(null)}>Menu</a>
          <a href="#cart">Cart ({cart.length})</a>
        </nav>
      </header>

      <main className="main-content">
        {!currentTag ? (
          <div className="menu-list">
            {categories.map((cat) => (
              <CategoryCard key={cat.tag} category={cat} onClick={setCurrentTag} />
            ))}
          </div>
        ) : (
          <div className="menu-list">
            {items.map((item) => (
              <ItemCard key={item.id} item={item} onAddToCart={addToCart} />
            ))}
          </div>
        )}
        {showPopup && <div className="popup">Item added to cart!</div>}
      </main>

      <footer className="footer">
        <p>&copy; 2025 Virtual Restaurant</p>
      </footer>
    </div>
  );
}

export default App;
